import React, { useState } from "react";

export default function AdminML() {
  const [training, setTraining] = useState(false);
  const [lastRun, setLastRun] = useState(null);
  const [accuracy, setAccuracy] = useState(null);
  const [loss, setLoss] = useState(null);
  const [topPreferences, setTopPreferences] = useState([]);

  const startTraining = () => {
    setTraining(true);

  fetch("http://localhost:5001/api/ml/train", { method: "POST" })
    .then((res) => res.json())
    .then((data) => {
      setTraining(false);
      setLastRun(new Date().toLocaleString());
      if (data.success) {
        setAccuracy(data.precision);  // now precision
        setLoss(data.recall);         // optional: show recall in "loss" field
        setTopPreferences(data.topPreferences || []);
      }
    });
  };

  return (
    <div
      style={{
        marginLeft: "240px",
        padding: "30px",
        fontFamily: "Segoe UI, sans-serif",
        backgroundColor: "#f9fafb",
        minHeight: "100vh",
      }}
    >
      <div
        style={{
          background: "#fff",
          padding: "30px",
          borderRadius: "12px",
          boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
          maxWidth: "800px",
          margin: "auto",
        }}
      >
        <h2
          style={{
            marginBottom: "20px",
            color: "#1e3a8a",
            fontSize: "28px",
            fontWeight: "700",
          }}
        >
          Machine Learning Module
        </h2>

        <button
          onClick={startTraining}
          disabled={training}
          style={{
            backgroundColor: training ? "#9ca3af" : "#2563eb",
            color: "#fff",
            border: "none",
            padding: "12px 24px",
            borderRadius: "8px",
            fontSize: "16px",
            cursor: training ? "not-allowed" : "pointer",
            transition: "background-color 0.2s",
          }}
        >
          {training ? "Training in progress..." : "Train Model"}
        </button>

        <div style={{ marginTop: "20px", lineHeight: "1.8" }}>
          {lastRun && (
            <p style={{ fontSize: "16px", color: "#374151" }}>
              <strong>Last trained:</strong> {lastRun}
            </p>
          )}
          {accuracy !== null && (
            <p style={{ fontSize: "16px", color: "#374151" }}>
              <strong>Accuracy:</strong> {(accuracy * 100).toFixed(2)}%
            </p>
          )}
          {loss !== null && (
            <p style={{ fontSize: "16px", color: "#374151" }}>
              <strong>Loss:</strong> {loss.toFixed(4)}
            </p>
          )}
        </div>

        <div style={{ marginTop: "30px" }}>
          <h3
            style={{
              fontSize: "20px",
              color: "#111827",
              marginBottom: "10px",
            }}
          >
            Top Preferences
          </h3>
          {topPreferences.length > 0 ? (
            <ol
              style={{
                background: "#f3f4f6",
                padding: "20px",
                borderRadius: "8px",
                lineHeight: "1.8",
              }}
            >
              {topPreferences.map((pref, i) => (
                <li
                  key={i}
                  style={{
                    fontSize: "16px",
                    color: "#1f2937",
                    padding: "4px 0",
                    borderBottom:
                      i !== topPreferences.length - 1
                        ? "1px solid #e5e7eb"
                        : "none",
                  }}
                >
                  {pref}
                </li>
              ))}
            </ol>
          ) : (
            <p style={{ color: "#6b7280" }}>No preferences found.</p>
          )}
        </div>
      </div>
    </div>
  );
}
